import { createRouter, createWebHistory } from 'vue-router'
import Join from "../components/join_page.vue"
import Reg from "../components/reg_page.vue"
import Main_page from "../components/main_page.vue"
import Brone from "../components/broneclass_element.vue"
import Profile from "../components/profile_element.vue"
import Welcome from "../components/hi_element.vue"
import My_class from "../components/my_class.vue"

const routes = [
  {
    path: '/',
    name: 'join',
    component: Join
  },
  {
    path: '/register',
    name: 'Register',
    component: Reg
  },
  {
    path: '/main',
    name: 'Main Page',
    component: Main_page,
    children: [
      {
        path: 'welcome',
        name: 'Welcome page',
        component: Welcome
      },
      {
        path: 'my_classes',
        name: 'User classes',
        component: My_class
      },
      {
        path: 'profile',
        name: 'Profile',
        component: Profile
      },
    ]
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
